import { Link, animateScroll as scroll } from "react-scroll";

const Header = ({ setScreen }) => {
  return (
    <div className="section header">
      <div
        className="inner"
        data-aos="fade"
        data-aos-duration="1500"
        data-aos-delay="500"
      >
        <div
          className="logo"
          onClick={() => {
            setScreen("home");
            scroll.scrollToTop();
          }}
        >

          <h1>Blockchain</h1>
          <h1 className="blue">Unmasked</h1>
        </div>
        <div>
          <Link
            activeClass="active"
            to="about"
            spy={true}
            smooth={true}
            offset={-80}
            duration={500}
            onClick={() => setScreen("home")}
          >
            <button>About Us</button>
          </Link>
          <Link
            activeClass="active"
            to="services"
            spy={true}
            smooth={true}
            offset={-80}
            duration={500}
            onClick={() => setScreen("home")}
          >
            <button>Services</button>
          </Link>
          <Link
            activeClass="active"
            to="verify"
            spy={true}
            smooth={true}
            offset={-80}
            duration={500}
          >
            <button
              className="verify"
              onClick={() => {
                setScreen("forms");
                scroll.scrollToTop();
              }}
            >
              Verify Today
            </button>
          </Link>
        </div>
      </div>
    </div>
  );
};

export default Header;
